const BgIcon4 = (props) => (
  <svg preserveAspectRatio="none" viewBox="0 0 48 48" fill="none" xmlns="http://www.w3.org/2000/svg" {...props}>
    <circle cx="24" cy="24" r="24" fill="#0053A0" />
  </svg>
);

const MemoBgIcon4 = memo(BgIcon4);
export { MemoBgIcon4 as BgIcon4 };
